package com.gumtree.controller;

import com.gumtree.exception.BadRequestException;
import com.gumtree.model.Item;
import com.gumtree.model.User;
import com.gumtree.repository.ItemRepository;
import com.gumtree.repository.UserRepository;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.http.HttpStatus;
import org.springframework.http.ResponseEntity;
import org.springframework.web.bind.annotation.*;
import java.util.List;
import java.util.Map;

@RestController
@RequestMapping("carts")
public class ItemController {

    @Autowired
    private ItemRepository itemRepository;

    @Autowired
    private UserRepository userRepository;

    // get all items for a cart
    @GetMapping("/{userId}")
    public List<Item> getCart(@PathVariable Long userId) {
        User user = userRepository.findById(userId)
                .orElseThrow(() -> new BadRequestException("Cart not found for this user"));

        return itemRepository.findAllByUser(user);
    }

    // add item to a cart
    @PostMapping("/{userId}")
    public Item addToCart(@PathVariable Long userId, @RequestBody Map<String, String> body) {
        String itemName = body.get("itemName");

        User user = userRepository.findById(userId)
                .orElseThrow(() -> new BadRequestException("User not found"));

        // check if item already exists in cart
        if (itemRepository.existsByNameAndUser(itemName, user)) {
            throw new BadRequestException("Item already added to cart");
        }

        Item item = new Item();
        item.setUser(user);
        item.setName(itemName);
        item.setQuantity(1);

        return itemRepository.save(item);
    }

    // update item quantity
    @PutMapping("/{userId}/{itemName}")
    public Item updateItemQuantity(@PathVariable Long userId, @PathVariable String itemName, @RequestBody int quantity) {
        User user = userRepository.findById(userId)
                .orElseThrow(() -> new BadRequestException("User not found"));

        Item item = itemRepository.findByNameAndUser(itemName, user)
                .orElseThrow(() -> new BadRequestException("Item not found in cart"));

        item.setQuantity(quantity);
        return itemRepository.save(item);
    }

    // delete item from cart
    @DeleteMapping("/{userId}/{itemName}")
    public ResponseEntity<?> deleteItem(@PathVariable Long userId, @PathVariable String itemName) {
        User user = userRepository.findById(userId)
                .orElseThrow(() -> new BadRequestException("User not found"));

        Item item = itemRepository.findByNameAndUser(itemName, user)
                .orElseThrow(() -> new BadRequestException("Item not found in cart"));

        itemRepository.delete(item);
        return new ResponseEntity<>(HttpStatus.OK);
    }
}


